/*
百度统计依赖http头中的Referer字段来区分发送统计请求的页面，
在插件中发送的统计请求的http头都是没有Referer字段的，
需要额外添加下
*/
chrome.webRequest.onBeforeSendHeaders.addListener(function(data) {
    var xdata = data.requestHeaders;
    var url = data.url;
    /*
    如果是插件发送的请求，添加Referer字段
    */
    if (/si=3b231847743b9335bfaccda43a1abc1b/.test(url)) {
        xdata.push({
            name: 'Referer',
            value: 'http://fanyi.baidu.com/referrer'
        });
    }
    return {
        requestHeaders: xdata
    };
}, {
    urls: ['*://hm.baidu.com/*']
}, ['requestHeaders', 'blocking']);

